import Button from "react-bootstrap/Button";
import "./App.css";
import BookTable1 from "./BookTable1";
import NavigationBar from "./NavigationBar";
import AddAuthor from "./AddAuthor";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <NavigationBar/>
        <Routes>
          <Route path="/" element={<BookTable1 books={bookList} />} />
          <Route path="/addAuthor" element={<AddAuthor/>} />
          <Route path="/showBooks" element={<BookTable1/>} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
